   Game Notes:
    ~~~~~~~~~~~
    America is yours for the taking: from colonizing the East to settling
    the Wild West - give it your best shot! Step into the role of a
    Spanish conqueror, Native American, patriot, or settler and experience
    six thrilling adventures where you'll encounter countless eccentric
    personalities determined to put a bullet through your head. Show them
    who's boss: use special forces or bounty hunters, or rely on your wits
    alone to get your enemies before they get you. In No Man's Land you need
    the true spirit of America to brave the dangers of the New World,
    whether fighting the War of Independence or building a transcontinental
    railroad. Become a pioneer and live your very own American Dream!

    Game Features:
    ~~~~~~~~~~~~~~
    * Thrilling 3D real-time-strategy game
    * Discover the New World from the first colonies through settling 
      the Wild West
    * 6 exciting stories in 3 campaigns
    * 6 cultures with individual strengths and weaknesses: Spaniards, 
      British, forest and prairie Native Americans, patriots and settlers
    * Heroes and elite units: snipers, conjurers, assassins and more
    * Hire bounty hunters to bring down your opponents
    * Detailed and colorful sites throughout Northern America
    * Enthralling naval and land battles
    * Technological progress: from canoes to frigates; from stage coaches 
      to steam trains
    * Action-packed missions with surprising story twists
    * Good tactics can improve the stats of your units
    * Use nonconventional 'weapons' to bring down your foes such as plagues 
      and bark beetles
    * A brand new multiplayer game: railway construction challenge
    * Rich fauna including bears, mountain goats, prairie dogs and more

